import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import AppLivestorm from './App/AppLivestorm/AppLivestorm'
import Library from "./Library/AppLibrary/AppLibrary"
import './LivestormTestHome.css';
import { BsFillPeopleFill , BsFillCollectionPlayFill } from "react-icons/bs";



export default function LivestormTestHome() {

    return (
    <Router>
    <div className='nav-bar'><div className='nav-buttons'>
    <BsFillPeopleFill size='30' style={{margin:'10px'}} onClick={()=>{alert('clicked')}}/>
    <BsFillCollectionPlayFill size='30' style={{margin:'10px'}} />
    </div></div>
        <div>
          <Switch>
              <Route exact path='/livestorm-test' component={AppLivestorm} />
              <Route path='/livestorm-test/library' component={Library} />
          </Switch>
        </div>
      </Router>
    );
}
